  const {id}= useParams();
  const history=useHistory()
  const post=posts.filter((ele)=>{
   return (ele.id==id)
  })
  console
  return (
    <div className='spacing overflow-auto ms-3 '>
      <h2>{post[0].title}</h2>
      <p>{post[0].timeAndDate}</p>
      <p>
        {post[0].body}
      </p>
      <button className='col-3 btn btn-danger' onClick={(e)=>{deletepost(e,id)}}>Delete Post</button>
    </div>
  )
}

